import React from 'react';
import { View, Text, Button, TextInput, StyleSheet } from 'react-native';

export default class Start extends React.Component {
  constructor(props) {
    super(props)
    state = { name: '',
              backgroundColor: ''
    };
  }

  changeColor(){
    if(!this.state.pressed){
       this.setState({ pressed: true,backgroundColor: 'powderblue'});
    } else {
      this.setState({ pressed: false, backgroundColor: 'red'});
    }
  }
  
  render() {
    return (
      <View className="startWrap" styles={styles.backgroundStyle}>
      <View style={{flex: 1, flexDirection: 'column'}}>
      <View style={{width: 50, height: 50, backgroundColor: 'powderblue', borderRadius: '50'}}
        onPress={() => this.props.navigation.navigate('powerder')} />
      <View style={{width: 50, height: 50, backgroundColor: 'skyblue', borderRadius: '50'}} />
      <View style={{width: 50, height: 50, backgroundColor: 'steelblue', borderRadius: '50'}} />
      </View>
        <View style={{flex:1, justifyContent: 'center', alignItems: 'center'}}>
        <Text>Username</Text>
        <TextInput
         style={{height: 40, borderColor: 'gray', borderWidth: 1}}
         onChangeText={(name) => this.setState({name})}
         value={this.state.name}
         placeholder='Type here ...'
       />
       <Text>You wrote: {this.state.name}</Text>
        <Button
          title="Go to Chat"
          onPress={() => this.props.navigation.navigate('Chat', { name: this.state.name })} />
      </View>
      </View>
      
    )
  }
};

const styles = StyleSheet({
  backgroundStyle: {
    flex: 1
  }
})
